/* Material Tailwind Input */
.mt-input + label:after {
        content: '';
        pointer-events:none;
        position:absolute;
        top:0.125rem;
        left:0px;
        height:100%;
        width:100%;
        --tw-translate-x:0;
        --tw-translate-y:0;
        --tw-rotate:0;
        --tw-skew-x:0;
        --tw-skew-y:0;
        --tw-scale-x:1;
        --tw-scale-y:1;
        transform:translateX(var(--tw-translate-x)) translateY(var(--tw-translate-y)) rotate(var(--tw-rotate)) skewX(var(--tw-skew-x)) skewY(var(--tw-skew-y)) scaleX(var(--tw-scale-x)) scaleY(var(--tw-scale-y));
        --tw-scale-x:0;
        border-width:1px;
        border-top-width:0px;
        border-left-width:0px;
        border-right-width:0px;
        border-bottom-width:2px;
        transition-property:all;
        transition-timing-function:cubic-bezier(0.4, 0, 0.2, 1);
        transition-duration:150ms;
        transition-duration:300ms;
    }
.mt-input:focus + label:after{--tw-scale-x:1}
.mt-input:not(:-moz-placeholder-shown) + label span {
        top: -14%;
    }
.mt-input:not(:-ms-input-placeholder) + label span {
        top: -14%;
    }
.mt-input:focus + label span,
    .mt-input:not(:placeholder-shown) + label span {
